import React, { Component } from 'react';
import { request_token, request_pages } from '../tools/ApiCalls';
import { makeStyles } from '@material-ui/core/styles';
import { withStyles } from '@material-ui/core/styles';
import {Row, Col} from 'react-bootstrap';
import LoaderComponent from './loader'

const styles = {
    movieColumn: {
      marginBottom: 20
    }
  }

const Movies = ({ movies, isLoading }) => {
    const mov =movies ? movies.map.map(display => (
        <Col item xs={12} sm={4} md={3} lg={3} key={display.id} spacing={3} style={styles.movieColumn}>
            <movieCard movie={display} />
      </Col>

    )) : null
    ;
    return (
        <Row>
            {mov}
            <LoaderComponent isLoading={isLoading} />
        </Row>
    );
}


export default Movies;
